import {NavLink} from "react-router-dom";

export default function Root() {

    return (
        <div className={S.root}>
           первая страница
            <NavLink
                to="contacts"
                // style={({ isActive }) =>
                //     isActive ? activeStyle : undefined
                // }
            >
                2 page
            </NavLink>
        </div>
    );
}
